
import React from 'react'
import Card from "./card";
function Header(){

const Cards=[
{
    title: "Web Dev",
    subtitle: 'Front-end Developer',
    des:"Web development is the work involved in developing a Web site for the Internet (World Wide Web) or an intranet (a private network). ... Among Web professionals, Web development usually refers to the main non-design aspects of building Web sites: writing markup and coding.",
    image:"data:image/jpeg;base64,",
},

{
    title: "App Dev",
    subtitle: 'App Developer',
    des:"Mobile, sometimes called application or iOS, Developers use programming languages and source code to create software. ... They may also test, debug, and improve applications for clients and often collaborate with product and design teams.",
    image:"data:image/jpeg;base64,",
},

{
    title: 'Graphic Designing',
    subtitle: 'Designer',
    des: 'Design is the process of creating visual content to communicate information/ messages to the masses. Considered to be a sub-set of Communication Design, Graphic Design is used to create visual content using elements such as photographs, colours, typography, illustrations, and icons',
    image:'https://99designs-blog.imgix.net/blog/wp-content/uploads/2018/06/Types-of-graphic-design.jpg?auto=format&q=60&w=1860&h=1090&fit=crop&crop=faces',
},
{
    title: 'Digital Marketing',
    subtitle: 'Branding',
    des: ' Digital marketing can be defined as the marketing method to sell/buy/promote/advertise a product(s) or service(s) online or over the internet and other digital platforms. The digital marketing process is a term with a broad meaning and covers various methods and processes to achieve digital marketing goals and objectives.',
    image:'data:image/png;base64,',
},
{
    title: 'Data Scientist',
    subtitle: 'Machine Larning',
    des: 'A person employed to analyze and interpret complex digital data, such as the usage statistics of a website, especially in order to assist a business in its decision-making.',
    image:'data:image/jpeg;base64,',
},
]


return (
    <div className="container">
    {
        Cards.map((card,index) => (
            <Card title={card.title} des={card.des} subtitle={card.subtitle} image={card.image} />
        ))
    }
    </div>
)
}


export default Header;
